import React, { useContext } from 'react'
import TodoContext from '../context/TodoContext'

const TodoList = () => {
    const [tasks] = useContext(TodoContext)

    return (
        <>
            <div className="">
                <ul className="divide-y-2">
                    {tasks.map(task => {
                        return (
                            <li key={task.id}>{task.title}</li>
                        )
                    })}
                </ul>
            </div>
        </>
    )
}

export default TodoList
